import React from 'react'

export default function Story() {
  return (
    <div style={{backgroundColor: 'white'}}>
        <div style={{display:'flex', width: '100%'}}>
            <span style={{display:'flex', width: '100%',justifyContent: 'center'}}>Tin</span>
            <span style={{display:'flex', width: '100%',justifyContent: 'center'}}>Reels</span>
        </div>
    </div>
  )
}
